import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on a category to navigate to a page with view toggle options
    await page.waitForSelector('.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('.category-card:has-text("Electronics")');

    // Wait for view toggle buttons to appear
    await page.waitForSelector('.view-toggle', { timeout: 5000 });

    // Take screenshot before switching view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_switch.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_switch.png'));

    // Switch to list view by clicking the list view button
    await page.waitForSelector('button[title="List View"]', { timeout: 5000 });
    await page.click('button[title="List View"]');

    // Wait for the view to change to list mode
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Extract data to verify the switch was successful
    const viewMode = await page.$eval('.view-btn.active', el => el.title);
    const productLayout = await page.$eval('.products-list', el => el.className);

    return {
      success: true,
      action: "Switched to List View Mode",
      extractedData: {
        currentViewMode: viewMode,
        productLayout: productLayout
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
